/*Table structure for table `server_events` */

DROP TABLE IF EXISTS `server_events`;

CREATE TABLE `server_events` (
  `EventID` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `EventTime` int(11) unsigned NOT NULL,
